require 'googleauth'
require 'google/apis/vision_v1'
require 'pry'

service = Google::Apis::VisionV1::VisionService.new
service.authorization = \
    Google::Auth.get_application_default(['https://www.googleapis.com/auth/cloud-platform'])

#   image: {
